description:
Verenigd Koninkrijk / Verenigde Staten / Frankrijk
Drama / Thriller
128 minuten

een goede film

met Nicole Kidman, Sean Penn en Catherine Keener

Politieke intriges en misleiding bij de Verenigde Naties in New York. Een VN-tolk (Kidman) hoort bij toeval dat er plannen worden 
gemaakt voor een moordaanslag op een Afrikaanse leider. De Amerikaanse Geheime Dienst wordt ingeschakeld om een onderzoek in te 
stellen. De doorgewinterde agent Keller (Sean Penn) vermoedt echter dat Silvia niet de hele waarheid vertelt.:
